import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function WelcomeScreen() {
  const navigate = useNavigate();

  return (
    <div className="tactical-bg cursor-reticle relative min-h-screen w-full flex flex-col justify-between items-center text-[var(--color-gloss-white)] font-sans overflow-hidden">
      {/* Animated background gradient */}
      <div className="bg-animated-gradient" />

      {/* Centered Hero Content */}
      <div className="flex-1 flex flex-col items-center justify-center z-10">
        <div className="hero-stack-tactical">
          <div className="hero-ares-tactical">ARES</div>
          <div className="hero-terminal-tactical">TRADING TERMINAL</div>
          <div className="hero-subline-tactical">THE MEME COIN DEFI EXCHANGE</div>
          <button
            className="hero-btn-tactical"
            onClick={() => navigate('/feed')}
          >
            ENTER<span className="blinking-cursor">_</span>
          </button>
        </div>
      </div>
      <div className="hero-meta-bar">Careers (2) &nbsp;|&nbsp; Powered by Solana &nbsp;|&nbsp; Status: Live</div>
    </div>
  );
}
